import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./pages/Login";


function App() {
  return (
    <BrowserRouter>
      <Routes>
          <Route index element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
